  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kodiak NWR outlines
  Refuge accomplishments from May through August of 1950. The report begins by summarizing
  the weather conditions during this period. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, and raptors- is also covered. The
  Refuge development and maintenance section discusses physical developments and wildfires.
  The public relations section of the report describes Refuge visitors, hunting, fishing,
  and violations.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
